import React, { useState, useContext } from "react";
import { NavLink, useNavigate } from "react-router-dom";
import { adddata } from "./context/ContextProvider";
import { Button, Typography, Stack, TextField, Select, Paper, Box, MenuItem } from '@mui/material';
import Home from "./Home";
import FieldArray from "../components/FieldArray";
import { reduxForm } from 'redux-form';


const statusOptions = ["QUEUED","IN-PROGRESS","SUCCESS","FAILURE"];
  // {
  //   value: 'QUEUED',
  //   label: 'Queued',
  // },
  // {
  //   value: 'IN-PROGRESS',
  //   label: 'In Progress',
  // },
  // {
  //   value: 'SUCCESS',
  //   label: 'Success',
  // },
  // {
  //   value: 'FAILURE',
  //   label: 'Failure',
  // },
// ];

const findingFields = [
  {
    name: 'type',
    label: 'Type',
    type: 'text',
  },
  {
    name: 'ruleId',
    label: 'Rule Id',
    type: 'text',
  },
  {
    name: 'location.path',
    label: 'Location Path',
    type: 'text',
  },
  {
    name: 'location.positions.begin.line',
    label: 'Begin position',
    type: 'text',
  },
  {
    name: 'metadata.description',
    label: 'Description',
    type: 'text',
  },
  {
    name: 'metadata.severity',
    label: 'Severity',
    type: 'text',
  },
];

const Register = () => {
  const { udata, setUdata } = useContext(adddata);

  const navigate = useNavigate("");

  const [inpval, setINP] = useState({
    status: "",
    name: "",
    queued: "",
    scanning: "",
    finished: "",
    type: "",
    rule: "",
    path: "",
    pos: "",
    desc: "",
    severity: "",
  });

  const setdata = (e) => {
    console.log(e.target.value);
    const { name, value } = e.target;
    setINP((preval) => {
      return {
        ...preval,
        [name]: value,
      };
    });
  };

  //Sending data from frontend->backend via fetch api
  const addInpData = async (e) => {
    e.preventDefault();

    const {
      status,
      name,
      queued,
      scanning,
      finished,
      type,
      rule,
      path,
      pos,
      desc,
      severity,
    } = inpval;

    const res = await fetch("/register", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        status,
        name,
        queued,
        scanning,
        finished,
        type,
        rule,
        path,
        pos,
        desc,
        severity,
      }),
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      alert("Error");
      console.log("Error");
    } else {
      navigate("/");
      setUdata(data);
      console.log("Data has been added");
    }
  };

  return (
    <div className="container">
      <div className="add_btn mt-2 mb-2">
        <Typography variant="h5">Add New Scan
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
        <a href='./'>
          <Button variant="outlined" sx={{height: 50, width: 195}} onClick={() => ""} alignItems="right">
            <Stack direction="row" alignItems="center" justifyContent={"center"}>
              <Typography><span style={{ fontWeight: 'bold' }}>GO TO DASHBOARD</span></Typography>
            </Stack>
          </Button>
          </a>
          </Typography>
        </div>
      {/* <form className="mt-5"> */}
        <div className="column">
        <Box component={Paper} p={2}>
          <div className="row">
            <TextField label="Repository Name"  name="repository_name"  onChange={setdata}/> 
            {/* className="form-label">
              <b>Repository Name</b>
            </label> */}
            {/* <input
              type="text"
              value={inpval.name}
              onChange={setdata}
              name="name"
              className="form-control"
            /> */}
          </div>
          <div className="row">
            <>Status</>
          <Select name="status" onChange={setdata}>
          {statusOptions.map((option) => (
            <MenuItem key={option} value={option}>{option}</MenuItem>
          ))}</Select>
          <Box display="flex" justifyContent="space-between" marginY={2}></Box>
            {/* <br />
            <select
              name="status"
              value={inpval.status}
              onChange={setdata}
            >
              <option value="" disabled selected hidden>
                Choose An Option
              </option>
              <option value="Queued">Queued</option>
              <option value="In Progress">In Progress</option>
              <option value="Success">Success</option>
              <option value="Failed">Failed</option>
            </select> */}
          </div>
          <div className="row">
          <div className="col-4">
            {/* <label className="form-label">
              <b>Queued At</b>
            </label> */}
            <>Queued At</>
            <input
              type="datetime-local"
              value={inpval.queued}
              onChange={setdata}
              name="queued"
              className="form-control"
            />
          </div>
          <div className="col-4">
            {/* <label className="form-label">
              <b>Scanning At</b>
            </label> */}
            <>Scanning At</>
            <input
              type="datetime-local"
              value={inpval.scanning}
              onChange={setdata}
              name="scanning"
              className="form-control"
            />
          </div>
          <div className="col-4">
            {/* <label className="form-label">
              <b>Finished At</b>
            </label> */}
            <>Finished At</>
            <input
              type="datetime-local"
              value={inpval.finished}
              onChange={setdata}
              name="finished"
              className="form-control"
            />
          </div>
          </div>

          <br></br>

          {/* <div className="row">
            <FieldArray
              name="findings"
              label="Finding"
              addButtonText="Add finding"
              removeButtonText="Remove"
              fields={findingFields}/>
          </div> */}

          <Box m={2} p={1} bgcolor="#efefef" borderRadius={4}>
          <div className="row">
          <Typography variant="h5">Findings</Typography>
          <div className="mb-3 col-lg-6 col-md-6 col-12">
          <TextField label="Type"  name="type" onChange={setdata}/> 
            {/* <label className="form-label">
              <b>Type</b>
            </label>
            <input
